import { GlobalStyle } from "../styles/GlobalStyle";
import {
	Logo,
	Container,
	Texto,
	ButLoading,
	SpanYelloW,
} from "../styles/Loading";

const Loading = () => {
	return (
		<div>
			<Container>
				<Logo>
					<img className="logo-image" src="/images/logo.png" />
				</Logo>
				<ButLoading />
				<Texto>
					Estamos <SpanYelloW>buscando ...</SpanYelloW>
					<br />
					espera un poco más <SpanYelloW>Ü</SpanYelloW>
				</Texto>
			</Container>
		</div>
	);
};

export default Loading;
